import { ButtonFilled } from "../../atoms/ButtonFilled";
import { ButtonOutline } from "../../atoms/ButtonOutline";

import { Logo } from '../../atoms/Logo'
import { Navbar } from '../../molecules/Navbar'


export const Header = () => {
  return (
      <header>
        <Logo />
        <Navbar />
        <div>
          <ButtonFilled title="Abra a sua conta" />
          
        </div>
      </header>
    )
}
